import React, { Component } from "react";
import { Button, View, Text } from "react-native";

class Fitnessinfo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      courseList: [],
    };
  }

  componentDidMount() {
    // http://localhost:8080
    fetch("/Reading/api/file")
      .then((response) => {
        if (!response.ok) {
          throw new Error("HTTP error " + response.status);
        }
        return response.json();
      })
      .then((json) => {
        this.users = json;
        //console.log(this.users);
      })
      .catch(function () {
        this.dataError = true;
      });
  }

  render() {
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Datum</th>
              <th>Name</th>
              <th>Preis</th>
              <th>Beschreibung</th>
            </tr>
          </thead>
          <tbody>
            {this.state.courseList.map((fitness) => (
              <tr key={fitness.id}>
                <td>{moment(fitness.date).format("Do MMM YYYY")} </td>
                <td>{fitness.name} </td>
                <td>{fitness.price}</td>
                <td>{fitness.description}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default Fitnessinfo;
